"""# Sixth Step = Building NN model

Keras is an open-source software library that provides a Python interface for artificial neural networks.
The methods and classes being used include Sequential(), layers.MaxPolling2D(), layers.Cov2D(), and .add().
"""

#Neural Networks Model
model = Sequential()

"""Sequential() is a class in the keras library.

A class is like a group of related methods. So for example the Rectangle() class has methods like findArea() findPerimeter(), findLength(), and findWidth() that are all related to rectangles.  

The Sequential() class has methods that group arrays of numbers (remember these numbers would be the pixels of an image) into information a neural network can process.
![mnist_1layer.png](data:image/png;base64,)

Neural Networks have many layers (initial, hidden, output)
so we are going to add layers to our neural network 'model'
"""

model = Sequential()

#This is the input layer that will take in a 300X300 pixel image
model.add(layers.Input(shape = training_iterator.image_shape))

#This is the first hidden layer, Conv2D stands for convulotional 2Dimensional, which reduces the info
# given by 300x300 to a smaller group of numbers (ie. 100x100)
model.add(layers.Conv2D(16, 3, padding ='same', activation = 'relu')) #batch size = 16, RBG = 3 color values

# reduces the info given by the hidden layer to an even smaller group of numbers (ie. 10x10)
model.add(layers.MaxPooling2D())

#Your Code Here - Add your own hidden layers (model after code on top) you can change batch size and activation functions
model.add(layers.Conv2D(16, 3, padding ='same', activation = 'relu')) #batch size = 16, RBG = 3 color values

# Now that you've summarized the info gathered from your image into say 10X10 pixels,
# it's just going to take the 2D and flatten into 1D (so a long list of 100 pixels)
model.add(layers.Flatten())

model.add(layers.Dense(3, activation = 'softmax'))

"""![Screen Shot 2021-02-23 at 11.11.32 PM.png](data:image/png;base64,)![Screen Shot 2021-02-23 at 11.11.22 PM.png](data:image/png;base64,)![Screen Shot 2021-02-23 at 11.11.18 PM.png](data:image/png;base64,)![Screen Shot 2021-02-23 at 11.11.11 PM.png](data:image/png;base64,)![Screen Shot 2021-02-23 at 11.11.06 PM.png](data:image/png;base64,)![Screen Shot 2021-02-23 at 11.11.00 PM.png](data:image/png;base64,)![Screen Shot 2021-02-23 at 11.10.57 PM.png](data:image/png;base64,)![Screen Shot 2021-02-23 at 11.10.48 PM.png](data:image/png;base64,)

# Seventh Step = Compile the Model (accuracy)
compiling = transformation from source code (human readable) into machine code (computer executable)

optimizer = the process of modifying a software system to make some aspect of it work more efficiently (shorter and faster)

- learning rate = how quickly our network replaces the concepts it has learned up until now with new ones
- Adam = learning rate optimization algorithm

loss / CategoricalCrossentropy = if predictions deviate too much from actual results, loss value is very high
- used for multi-class classification

metrics = influence how you weight the importance of different characteristics in the results

summary = returns a summarized representation of entire data frame
"""

#can change the value of the learning_rate
model.compile(
optimizer = tf.keras.optimizers.Adam(learning_rate = 0.005),
loss = tf.keras.losses.CategoricalCrossentropy(),
metrics = ['accuracy'])

model.summary()

